import{_ as a}from"./plugin-vue_export-helper-c27b6911.js";import{o as i,c as e,e as l}from"./app-d4062e36.js";const h={},r=l('<h1 id="舰队" tabindex="-1"><a class="header-anchor" href="#舰队" aria-hidden="true">#</a> 舰队</h1><h2 id="舰队有什么用" tabindex="-1"><a class="header-anchor" href="#舰队有什么用" aria-hidden="true">#</a> 舰队有什么用？</h2><ul><li>舰队是一种将玩家团结成一个团体的社区。对于舰队成员，可以使用内部聊天和统计图表。</li></ul><h2 id="舰队在赛季结束时会获得哪些奖励" tabindex="-1"><a class="header-anchor" href="#舰队在赛季结束时会获得哪些奖励" aria-hidden="true">#</a> 舰队在赛季结束时会获得哪些奖励？</h2><ul><li>目前，没有提供奖励。将在未来开发舰队机制。</li></ul><h2 id="创建舰队必须满足哪些要求" tabindex="-1"><a class="header-anchor" href="#创建舰队必须满足哪些要求" aria-hidden="true">#</a> 创建舰队必须满足哪些要求？</h2><ul><li>玩家必须达到游戏帐户的10级</li><li>玩家不得是任何其他舰队的成员</li><li>玩家必须支付10000黄金才能创建一个舰队</li></ul><h2 id="舰队中的角色是什么" tabindex="-1"><a class="header-anchor" href="#舰队中的角色是什么" aria-hidden="true">#</a> 舰队中的角色是什么？</h2><ul><li>舰队队长———拥有舰队的完全访问权限。</li><li>管理员———可以批准/拒绝舰队资格请求。可以发送舰队邀请。</li><li>成员———军团的普通成员。</li></ul><h2 id="战队评级" tabindex="-1"><a class="header-anchor" href="#战队评级" aria-hidden="true">#</a> 战队评级</h2><ul><li>根据舰队成员的活动，舰队成员的最大数量增加。在舰队的第 10 级，最大成员人数 - 200。</li></ul><h2 id="我不小心删除了舰队-是否可以恢复我的舰队或返还创建舰队的金币" tabindex="-1"><a class="header-anchor" href="#我不小心删除了舰队-是否可以恢复我的舰队或返还创建舰队的金币" aria-hidden="true">#</a> 我不小心删除了舰队，是否可以恢复我的舰队或返还创建舰队的金币？</h2><ul><li>不可以，移除军团是不可逆转的，无法恢复。</li></ul><h2 id="是否可以将舰队的领导权转移给另一个人" tabindex="-1"><a class="header-anchor" href="#是否可以将舰队的领导权转移给另一个人" aria-hidden="true">#</a> 是否可以将舰队的领导权转移给另一个人？</h2><h5>目前，舰队领导权的转移只能通过支持代理进行。舰队队长必须留下更改舰队队长的申请。必须包含：</h5><ul><li>舰队编号</li><li>舰队队长ID</li><li>舰队队长将转移的玩家的ID。</li></ul><div class="hint-container warning"><p class="hint-container-title">小贴士</p><p>支持代理可能会要求您提供其他数据，以确保您是真正的军团领袖。</p></div><h2 id="舰队活动点数是如何计算的" tabindex="-1"><a class="header-anchor" href="#舰队活动点数是如何计算的" aria-hidden="true">#</a> 舰队活动点数是如何计算的？</h2><ul><li>舰队活动点数仅在快速游戏模式下摧毁真实玩家时获得。（真实玩家有ID）</li><li>杀死一名舰队成员玩家将获得 10 点军团活动点数。杀死普通玩家将获得5个部落活动点数。</li></ul><h2 id="我可以使用现有舰队的名称和军团标签吗" tabindex="-1"><a class="header-anchor" href="#我可以使用现有舰队的名称和军团标签吗" aria-hidden="true">#</a> 我可以使用现有舰队的名称和军团标签吗？</h2><ul><li>不可以，禁止复制现有军团的名称和舰队标签。这些舰队的名称将被更改。</li></ul>',21),d=[r];function n(t,c){return i(),e("div",null,d)}const o=a(h,[["render",n],["__file","JD.html.vue"]]);export{o as default};
